import React, { useState, useEffect } from 'react';
import { Box, CssBaseline, CircularProgress, Typography } from '@mui/material';
import { styled } from '@mui/material/styles';
import {
  VideoCall as VideoIcon,
  OpenInFull as ExpandIcon,
  MoreVert as MoreIcon,
} from '@mui/icons-material';
import ChatWindow from './components/ChatWindow';

const AppContainer = styled(Box)(({ theme }) => ({
  display: 'flex',
  height: '100vh',
  backgroundColor: theme.palette.primary.dark,
  padding: theme.spacing(2),
}));

const ChatContainer = styled(Box)(({ theme }) => ({
  display: 'flex',
  gap: theme.spacing(2),
  width: '100%',
  maxWidth: 1600,
  margin: '0 auto',
  height: '100%',
}));

const LoadingContainer = styled(Box)(({ theme }) => ({
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  justifyContent: 'center',
  gap: theme.spacing(2),
  width: '100%',
  color: theme.palette.common.white,
}));

function App() {
  const [models, setModels] = useState([]);
  const [streamingResponses, setStreamingResponses] = useState({ left: '', right: '' });
  const [thinking, setThinking] = useState({ left: false, right: false });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchModels = async () => {
      try {
        // Add error handling for network issues
        const controller = new AbortController();
        const timeoutId = setTimeout(() => controller.abort(), 5000); // 5 second timeout

        const response = await fetch('http://192.168.56.1:1234/v1/models', {
          signal: controller.signal,
          headers: {
            'Accept': 'application/json',
            'Content-Type': 'application/json'
          },
        });

        clearTimeout(timeoutId);

        if (!response.ok) {
          throw new Error(`Server returned ${response.status}: ${response.statusText}`);
        }

        const data = await response.json();
        
        // LM Studio returns models in a different format
        const modelList = data.models || [];
        if (!modelList.length) {
          throw new Error('No models available in LM Studio. Please load a model first.');
        }

        setModels(modelList.map(model => ({
          id: model,  // LM Studio uses model name as ID
          name: model.split('/').pop() // Get the last part of the path as display name
        })));
        setError(null);
      } catch (error) {
        console.error('Error fetching models:', error);
        let errorMessage = error.message;
        if (error.name === 'AbortError') {
          errorMessage = 'Connection timed out. Is LM Studio running?';
        } else if (error.message === 'Failed to fetch') {
          errorMessage = 'Unable to connect to LM Studio. Please make sure:\n1. LM Studio is running\n2. Local Server is started in LM Studio\n3. The server address (192.168.56.1:1234) is correct';
        }
        setError(errorMessage);
      } finally {
        setLoading(false);
      }
    };

    const initializeApp = async () => {
      await fetchModels();
      // Set up polling for model updates
      const interval = setInterval(fetchModels, 30000);
      return () => clearInterval(interval);
    };

    initializeApp();
  }, []);

  if (loading) {
    return (
      <AppContainer>
        <CssBaseline />
        <LoadingContainer>
          <CircularProgress color="inherit" size={40} />
          <Typography variant="h6">
            Connecting to LM Studio...
          </Typography>
          <Typography variant="body2" sx={{ opacity: 0.7, textAlign: 'center' }}>
            Make sure LM Studio is running and the Local Server is started
          </Typography>
        </LoadingContainer>
      </AppContainer>
    );
  }

  if (error) {
    return (
      <AppContainer>
        <CssBaseline />
        <LoadingContainer>
          <Typography variant="h6" color="error">
            Unable to connect to LM Studio
          </Typography>
          <Typography variant="body1" color="error.light" sx={{ whiteSpace: 'pre-line', textAlign: 'center' }}>
            {error}
          </Typography>
          <Typography variant="body2" sx={{ opacity: 0.7, mt: 1, textAlign: 'center' }}>
            After fixing the issue, click refresh to try again
          </Typography>
        </LoadingContainer>
      </AppContainer>
    );
  }

  return (
    <AppContainer>
      <CssBaseline />
      <ChatContainer>
        <ChatWindow
          position="left"
          models={models}
          streamingResponse={streamingResponses.left}
          isThinking={thinking.left}
          setStreamingResponses={setStreamingResponses}
          setThinking={setThinking}
        />
        <ChatWindow
          position="right"
          models={models}
          streamingResponse={streamingResponses.right}
          isThinking={thinking.right}
          setStreamingResponses={setStreamingResponses}
          setThinking={setThinking}
        />
      </ChatContainer>
    </AppContainer>
  );
}

export default App;
